import React, { useEffect, useState } from "react";
//import Header from "../Header";
//import NotFound from "../NotFound";
import {
  Link,
  NavLink,
  Route,
  Switch,
  useParams,
  useRouteMatch,
} from "react-router-dom";


export default function Alert({alert})
{
    return( <div className="container my-4">

    <p className="font-weight-bold">An example of bootstrap alert auto close . Easy to implement and customize. Examples of basic and advanced usage.</p>

    <p>
      <strong>Detailed documentation and more examples you can find in our 
      <a href="https://mdbootstrap.com/docs/standard/components/alerts/" target="_blank">Bootstrap Alert Docs</a>
      </strong> 
    </p>


    <p class="font-weight-bold">Basic example - it will close automatically after 2 seconds</p>
    
  <div class="alert alert-success" role="alert">
  <button type="button" className="close" data-dismiss="alert" aria-label="Close"><span aria-hidden="true">&times;</span></button>
  <strong>Success!</strong> You have been signed in successfully!
</div>
</div>)
}
